import React, { useState } from 'react'

function Counter() {
    const [car, setCar] = useState(0);
    let inc = () => {
        // let a = 
        setCar(car+1);
    }
    let dec = () => {
        let a = car
        setCar(a-1);
    }
    return (
        <div>
        <button onClick={inc}>+</button>
        <button onClick={dec}>-</button>
        <h2>{car}</h2>
            </div>
    )
}

export default Counter
